import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';

const customer = {
  'id': 1,
  'image': 'https://pllaceimg.com/64/64/any',
  'name': '나동빈',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
}

class App extends Component {
  render() {
    return (
      <Customer 
        id={customer.id}
        image={customer.image}
        name={customer.name} 
        birthday={customer.birthday} 
        gender={customer.gender} 
        job={customer.job}
      />
    );
  }
}

export default App;
